import React from 'react';
import { Button } from 'semantic-ui-react';

const ButtonGroup = () => {
  return (
    <Button.Group>
      <Button>Media</Button>
      <Button>Contacts</Button>
    </Button.Group>
  );

}

export default ButtonGroup;
